channelHandler.value:
function(res) {
    const data = res.data.info.map(item => {
      const { id, channelId } = item;
      return {
        label: channelId,
        value: id,
      };
    });
    return data;
  }

getLinkText.value:
function(record) {
    const { status } = record || {};
    if (status === 0) {
      return '查看错误信息';
    } else if (status === 1) {
      return '去下载';
    }
    return '查看详情';
  }

onPageChange.value:
function(pageIndex, pageSize) {
    this.setSearchParams({
      page: pageIndex,
      page_size: pageSize,
    });
    this.fetchBuilds();
  }

onFinish.value:
function(values) {
    const formValues = Object.keys(values).reduce((pre, key) => {
      const value = values[key];
      if (value === undefined || value === null) {
        return pre;
      }
      return {
        ...pre,
        [key]: value,
      };
    }, {});
    this.setSearchParams(formValues);
    this.fetchBuilds();
  }

linkHandler.value:
function(_, record) {
    console.log('debug record', record);
    if (record && record.result_url) {
      window.open(record.result_url);
      return;
    }
    if (record && record.error_info) {
      this.setState({
        errorVisible: true,
        errorInfo: record.error_info,
      });
      return;
    }
    if (record && record.status === 0) {
      this.$utils.message.error('暂无错误信息！');
      return;
    }
    this.$utils.message.info('暂无详情信息！');
  }

